script:
const size = { x: 32, y: 15, z: 48 };
const origin = { x: -16, z: -24 };
const simplex = new SimplexNoise(Math.random());

reset();

box(
  origin.x - 1, 0, origin.z - 1,
  size.x + 2, size.y + 1, size.z + 2,
  (x, y, z) => {
    if (
      z > origin.z + 1 && z < origin.z + size.z - 2
      && y > 4 && y < 13
  	) {
      return 5;
    }
    return 3;
  }
);

box(
  origin.x, 1, origin.z,
  size.x, size.y, size.z,
  (x, y, z) => {
    if (
      z > origin.z + 1 && z < origin.z + size.z - 2
      && y > 4 && y < 13
  	) {
      return 4;
    }
    return 1;
  }
);

box(
  origin.x + 1, 1, origin.z + size.z * 0.5 - 1,
  size.x - 2, 1, 2,
  2
);

box(
  origin.x + 14, 1, origin.z + 3,
  4, 1, 4,
  2
);


box(
  origin.x + 1, 2, origin.z + 1,
  size.x - 2, size.y - 2, size.z - 2,
  0
);
box(
  origin.x + 2, size.y, origin.z + 2,
  size.x - 4, 2, size.z - 4,
  0
);

for (let i = 0; i < 2; i += 1) {
  box(
    origin.x + (i === 0 ? 1 : size.x - 2), 2, origin.z + 1,
    1, 1, size.z - 2,
    (x, y, z) => (
      z >= origin.z + size.z * 0.5 - 1
      && z <= origin.z + size.z * 0.5
     ) ? 0 : 1
  );
}

box(
  origin.x + 11, 2, origin.z + size.z - 7,
  10, 5, 1,
  2
);
box(
  origin.x + 12, 2, origin.z + size.z - 7,
  8, 4, 1,
  0
);

const elevator = {
  x: origin.x + 12,
  y: 0,
  z: origin.z + size.z - 1,
};
box(
  elevator.x + 2, size.y, elevator.z + 1,
  4, 1, 1,
  1
);
box(
  elevator.x + 2, size.y, elevator.z + 2,
  4, 1, 1,
  5
);
box(
  elevator.x + 1, elevator.y + 1, elevator.z + 1,
  6, 8, 6,
  3
);
box(
  elevator.x + 2, elevator.y + 8, elevator.z + 2,
  4, 1, 4,
  1
);
box(
  elevator.x + 2, elevator.y + 2, elevator.z + 2,
  4, 5, 4,
  0
);
box(
  elevator.x + 3, elevator.y + 2, elevator.z,
  2, 4, 2,
  0
);
